import React from 'react';
import { Box, Paper, Typography, Link, Divider, Chip } from '@mui/material';
import SearchIcon from '@mui/icons-material/Search';
import LaunchIcon from '@mui/icons-material/Launch';
import InfoIcon from '@mui/icons-material/Info';
import ErrorIcon from '@mui/icons-material/Error';

const SearchResultDisplay = ({ result }) => {
  if (!result) return null;

  // Determine source icon and color based on the source
  const getSourceDetails = (source) => {
    if (source === 'DuckDuckGo' || source === 'DuckDuckGo Related Topics') {
      return { 
        icon: <SearchIcon fontSize="small" />, 
        color: '#1976d2',
        name: source
      };
    } else if (source === 'AI Knowledge') {
      return { 
        icon: <InfoIcon fontSize="small" />, 
        color: '#2e7d32',
        name: 'AI Knowledge Base'
      };
    } else if (source === 'error') {
      return { 
        icon: <ErrorIcon fontSize="small" />, 
        color: '#d32f2f',
        name: 'Search Error'
      };
    } else {
      return { 
        icon: <SearchIcon fontSize="small" />, 
        color: '#ed6c02',
        name: 'Web Search'
      };
    }
  };

  const sourceDetails = getSourceDetails(result.source);

  return (
    <Paper
      elevation={1}
      sx={{
        p: 2,
        mb: 3,
        backgroundColor: '#f8f9fa',
        borderLeft: `4px solid ${sourceDetails.color}`,
        maxWidth: '100%',
      }}
    >
      <Box sx={{ display: 'flex', alignItems: 'center', mb: 1, justifyContent: 'space-between' }}>
        <Box sx={{ display: 'flex', alignItems: 'center' }}>
          <Box sx={{ 
            display: 'flex', 
            alignItems: 'center', 
            justifyContent: 'center',
            color: 'white',
            bgcolor: sourceDetails.color,
            width: 28,
            height: 28,
            borderRadius: '50%',
            mr: 1
          }}>
            {sourceDetails.icon}
          </Box>
          <Typography variant="subtitle1" fontWeight="medium" color="primary">
            Search Results
          </Typography>
        </Box>

        <Chip 
          size="small" 
          label={sourceDetails.name}
          color={result.source === 'error' ? 'error' : 'primary'}
          variant="outlined"
        />
      </Box>

      <Divider sx={{ mb: 2 }} />

      {result.abstractText && (
        <Box sx={{ mb: 2 }}>
          <Typography variant="body2" sx={{ mb: 1, lineHeight: 1.6 }}>
            {result.abstractText}
          </Typography>

          {result.abstractURL && (
            <Link 
              href={result.abstractURL} 
              target="_blank" 
              rel="noopener noreferrer"
              sx={{ 
                display: 'flex', 
                alignItems: 'center',
                fontSize: '0.875rem',
                mt: 0.5 
              }}
            >
              View source
              <LaunchIcon sx={{ ml: 0.5, fontSize: '0.875rem' }} />
            </Link>
          )}
        </Box>
      )}

      {result.relatedTopics && result.relatedTopics.length > 0 && (
        <Box>
          <Typography variant="body2" fontWeight="bold" sx={{ mb: 1, color: sourceDetails.color }}>
            Additional Resources:
          </Typography>

          <Box sx={{ 
            display: 'flex', 
            flexDirection: { xs: 'column', sm: 'row' }, 
            flexWrap: 'wrap',
            gap: 1 
          }}>
            {result.relatedTopics.map((topic, index) => (
              <Paper 
                key={index} 
                variant="outlined" 
                sx={{ 
                  mb: 1, 
                  p: 1.5, 
                  flex: { xs: '1 0 100%', sm: '1 0 45%' },
                  borderColor: '#e0e0e0',
                  borderRadius: 2,
                  transition: 'all 0.3s ease',
                  '&:hover': {
                    borderColor: sourceDetails.color,
                    bgcolor: 'rgba(0, 0, 0, 0.01)'
                  }
                }}
              >
                <Typography variant="body2" sx={{ mb: 0.5 }}>
                  {topic.text}
                </Typography>

                {topic.url && (
                  <Link 
                    href={topic.url} 
                    target="_blank" 
                    rel="noopener noreferrer"
                    sx={{ 
                      display: 'flex', 
                      alignItems: 'center',
                      fontSize: '0.775rem',
                      mt: 0.5 
                    }}
                  >
                    Visit
                    <LaunchIcon sx={{ ml: 0.5, fontSize: '0.775rem' }} />
                  </Link>
                )}
              </Paper>
            ))}
          </Box>
        </Box>
      )}

      <Typography variant="caption" color="text.secondary" sx={{ display: 'block', mt: 2, fontStyle: 'italic' }}>
        Information provided as a best effort based on available sources. Consider verifying from official channels for business-critical information.
      </Typography>
    </Paper>
  );
};

export default SearchResultDisplay;
